import styled from 'styled-components'

export const DividerVert = styled.div`
    width: 100%;
    margin: 1rem;
    height: 2px;
    background-color: black;
`

export const Thumbnail = styled.img`
    width: 100%;
    height: 100%;
    border-radius: 1rem;
    box-shadow: var(--shadow-light);
    object-fit: cover;
`

export const H2 = styled.h2`
font-size: 1.6rem;
`
